INSERT INTO VOCABULARY_TYPE (ID,VERSION,SHORT_TYPE,TYPE_NAME,TYPE_MEANING_TH,TYPE_DESCRIPTION_TH) VALUES (1,0,'n','Noun','คำนาม','คำนาม (Noun) คือ คำที่ใช้เรียกแทนชื่อคน (Person), สัตว์ (Animal),  สิ่งของ (Thing), สถานที่ (Place), ความคิด (Idea)');
INSERT INTO VOCABULARY_TYPE (ID,VERSION,SHORT_TYPE,TYPE_NAME,TYPE_MEANING_TH,TYPE_DESCRIPTION_TH) VALUES (2,0,'pron','Pronoun','คำสรรพนาม','คำสรรพนาม (Pronoun) คือ คำที่ใช้แทนคำนาม เพื่อไม่ต้องพูดนามนั้นซ้ำ ทำหน้าที่เป็นได้ทั้งประธานและกรรม เช่น I, You, He, She, It, They, We, His, Her, Some');
INSERT INTO VOCABULARY_TYPE (ID,VERSION,SHORT_TYPE,TYPE_NAME,TYPE_MEANING_TH,TYPE_DESCRIPTION_TH) VALUES (3,0,'v','Verb','คำกริยา','คำกริยา (Verb) คือ คำที่แสดงอาการหรือการกระทำในประโยค เช่น Play, Sing, Be, Have, Do, Can, Must');
INSERT INTO VOCABULARY_TYPE (ID,VERSION,SHORT_TYPE,TYPE_NAME,TYPE_MEANING_TH,TYPE_DESCRIPTION_TH) VALUES (4,0,'adj','Adjective','คำคุณศัพท์','คำคุณศัพท์ (Adjective) คือ คำที่ทำหน้าที่ขยายคำนาม โดยตำแหน่งจะอยู่หน้านามเสมอ หรือตามหลัง Verb to be และ Linking Verb เช่น Big, Small, Fast, Green, Red');
INSERT INTO VOCABULARY_TYPE (ID,VERSION,SHORT_TYPE,TYPE_NAME,TYPE_MEANING_TH,TYPE_DESCRIPTION_TH) VALUES (5,0,'adv','Adverb','คำกริยาวิเศษณ์','คำกริยาวิเศษณ์ (Adverb) คือ คำที่มีหน้าที่ขยายกริยา ขยายคุณศัพท์ และขยายกริยาวิเศษณ์ด้วยกันเอง เช่น Very, Badly, Quickly, Well');



