-- INSERT INTO VOCABULARY_TYPE (ID,CREATED_BY,CREATED_DATE,UPDATED_BY,UPDATED_DATE,VERSION,SHORT_TYPE,TYPE_NAME,TYPE_MEANING_TH,TYPE_DESCRIPTION_TH) VALUES (6,null,null,null,null,0,'prep','Preposition','คำบุพบท','คำบุพบท (Preposition) คือ คำที่ใช้บอกตำแหน่ง วันเวลา ทิศทาง สถานที่ หรือบอกความสัมพันธ์ระหว่างนามหรือสรรพนามกับคำอื่น ๆ เช่น To, At, With, In, After, On');
-- INSERT INTO VOCABULARY_TYPE (ID,CREATED_BY,CREATED_DATE,UPDATED_BY,UPDATED_DATE,VERSION,SHORT_TYPE,TYPE_NAME,TYPE_MEANING_TH,TYPE_DESCRIPTION_TH) VALUES (7,null,null,null,null,0,'conj','Conjunction','คำสันธาน','คำสันธาน (Conjunction) คือ คำที่ใช้เชื่อมคำกับคำ กลุ่มคำกับกลุ่มคำ หรือประโยคกับประโยค เช่น And, But, When, Or, So');
-- INSERT INTO VOCABULARY_TYPE (ID,CREATED_BY,CREATED_DATE,UPDATED_BY,UPDATED_DATE,VERSION,SHORT_TYPE,TYPE_NAME,TYPE_MEANING_TH,TYPE_DESCRIPTION_TH) VALUES (8,null,null,null,null,0,'interj','Interjection','คำอุทาน','คำอุทาน (Interjection) คือ คำที่ใช้บ่งบอกอารมณ์ ความรู้สึกที่เกิดขึ้นในตอนนั้น โดยมักจะเป็นภาษาพูด เช่น Oh!, Ouch! Well!');
-- INSERT INTO VOCABULARY_TYPE (ID,CREATED_BY,CREATED_DATE,UPDATED_BY,UPDATED_DATE,VERSION,SHORT_TYPE,TYPE_NAME,TYPE_MEANING_TH,TYPE_DESCRIPTION_TH) VALUES (9,null,null,null,null,0,'vt','Transitive Verb','สกรรมกริยา','สกรรมกริยา (Transitive Verb) คือ กริยาต้องการกรรมมารองรับ เช่น need, want, love, make, say, take, get');
-- INSERT INTO VOCABULARY_TYPE (ID,CREATED_BY,CREATED_DATE,UPDATED_BY,UPDATED_DATE,VERSION,SHORT_TYPE,TYPE_NAME,TYPE_MEANING_TH,TYPE_DESCRIPTION_TH) VALUES (10,null,null,null,null,0,'vi','Intransitive Verb','อกรรมกริยา','อกรรมกริยา (Intransitive Verb) คือ กริยาที่ไม่ต้องการกรรมมารองรับ เช่น rain, snow, wait, work, live, alive');

